import React from 'react';
import './Inse.css';

function Inse() {
  return (
    <div>
        <header id='Header'>
              <div></div>
              <div id='log'>
                    <img src='/img/usuario50.jpg' alt=''/>LOGIN
              </div>
              <div id='fecha' >
                    <input id="fechas" type="date" ></input>
              </div>
        </header>
        <body>
        
        <div >
            <img src='/img/usuario50.jpg' alt=''/>USUARIO
              </div>
        <div >
                    <img src='/img/usuario50.jpg' alt=''/>HUELLA
              </div>

        </body>
    </div>
  );
}
export default Inse;
